import "./App.scss";
import Header from "./Header";
import Home from "./pages/Home";
import About from "./pages/About";

function App() {
  return (
    <>
      <Header />
      <Home id={"home"} />
      <About id={"about"}/>
      <Home />
      <About />
    </>
  );
}
export default App;
